import List from './List.js';
import Form from './Form.js';
import { useState } from 'react';

const Todo = () => {
  const todosList = [
    {
      id: 1,
      content: '店予約する',
    },
    {
      id: 2,
      content: '卵買う',
    },
    {
      id: 3,
      content: '郵便出す',
    },
  ];

  const [toDo, setToDo] = useState(todosList);
  return (
    <>
      {todo.map(toDo => (
        <List key={toDo.id} toDo={toDo.content} />
      ))}
      <Form Todo={toDo} />
    </>
  );
};

export default Todo;
